-- En las tablas hijas los FK pueden ser null así cuando haya alguna eliminación en la tabla padre esta pase a ser null 

CREATE TABLE IF NOT EXISTS provincias (
    idProv INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    provincia VARCHAR(255) NOT NULL
);

-- Tabla: municipios
CREATE TABLE IF NOT EXISTS municipios (
    idMuni INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    municipio VARCHAR(255) NOT NULL,
    idProv INT NULL
);

-- Tabla: empresas
CREATE TABLE IF NOT EXISTS empresas (
    idEmp INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    empresa VARCHAR(255) NOT NULL,
    CUIT INT,
    direccion VARCHAR(255)
);

-- Tabla: jurisdiccion
CREATE TABLE IF NOT EXISTS jurisdiccion (
    idJuri INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    jurisdiccion VARCHAR(255) NOT NULL
);

-- Tabla: transporte
CREATE TABLE IF NOT EXISTS transporte (
    idTrans INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    tipo VARCHAR(255) NOT NULL
);

-- Tabla: linea
CREATE TABLE IF NOT EXISTS linea (
    idLinea INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    linea VARCHAR(255) NOT NULL,
    idEmp INT NULL,
    idJuri INT NULL,
    idTrans INT NULL,
    idMuni INT NULL
);

-- Tabla: genero
CREATE TABLE IF NOT EXISTS genero (
    idGenero INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    genero VARCHAR(15),
    abrGenero VARCHAR(1)
);

-- Tabla: descuento
CREATE TABLE IF NOT EXISTS descuento (
    idDto INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    descuento VARCHAR(80)
);

-- Tabla: ventasDescuento
CREATE TABLE IF NOT EXISTS ventasDescuento (
    idVtaDto INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    fecha DATE,
    idDto INT NULL,
    idGenero INT NULL,
    idTrans INT NULL,
    cantidad INT NOT NULL
);

-- Tabla: calendario
CREATE TABLE IF NOT EXISTS calendar (
    date DATE PRIMARY KEY NOT NULL,
    año INT,
    mesNro INT,
    diaNro INT,
    mesNom VARCHAR(15),
    diaNom VARCHAR(10),
    añoMes VARCHAR(20),
    CodAñoMes INT
);

-- Tabla: ventasLinea
CREATE TABLE IF NOT EXISTS ventasLinea (
    idVta INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    fecha DATE NULL,
    idLinea INT NULL,
    cantidad INT NOT NULL
);


