/* STORE PROCEDURE insertProvincia

SP que inserte una provincia en la tabla provincias 
que el id se agregue automaticamente +1 y con un upper busque si ya existe esa provincia
si ya existe no la debe dejar crear enviando codigo de error, 
si no existe se ejecuta el SP insertando la nueva provincia*/

DROP procedure IF EXISTS `insertProvincia`;

DELIMITER $$
$$
