USE datos_sube;

/* TRIGGERS TABLA VENTASLINEA
Se crea una tabla log para los delete y update de la tabla ventaslinea
La tabla contendrá los archivos antes de eliminarse, antes de actualizarse y luego de actualizarse
Se diferenciará la acción realizada por la columna acción.
Se crea un SP para colocar el motivo por el cual se elimina algun registro
*/
CREATE TABLE IF NOT EXISTS `logVentasLinea` (`idVta` INT NOT NULL,
                                             `fecha` DATE NULL,
                                             `idLinea` INT NULL,
                                             `cantidad` INT NULL,
                                             `user` VARCHAR(255) NOT NULL,
											 `FechaAccion` DATE NOT NULL,
                                             `HoraAccion` TIME NOT NULL,
											 `motivo` VARCHAR(255) DEFAULT NULL,
                                             `accion` VARCHAR(15)
                                             );

-- creamos el sp donde se almacenara el motivo por el cual se realiza la eliminacion

DROP PROCEDURE IF EXISTS `motivo_delete_VL`;

DELIMITER $$
 $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `motivo_delete_VL`(in p_motivo varchar (255)) 
BEGIN
UPDATE `logVentasLinea`
SET `motivo` = p_motivo WHERE motivo IS NULL ;
END$$ 
 
 
 /* TRIGGER bef_del_ventasLineas_logVentasLinea
en la tabla logVentasLinea se registrara con un trigger before delete:
todos los campos de la tabla ventaslinea que se eliminan
el usuario
la fecha
la hora
el motivo por el que lo elimina (llamando al SP "motivo_delete")
la accion realizada
*/
DELIMITER ;


DROP TRIGGER IF EXISTS `bef_del_ventasLineas_logVentasLinea`;


DELIMITER $$
$$
CREATE TRIGGER `bef_del_ventasLineas_logVentasLinea`
BEFORE
DELETE ON ventaslinea
FOR EACH ROW BEGIN
VALUES (OLD.idVta,
        OLD.fecha,
        OLD.idLinea,
        OLD.cantidad,
        USER(),
        curdate(),
        curtime(), 
        NULL,
		"Delete"
        ); 
	CALL motivo_delete_VL("algun motivo"); 
END $$

DELIMITER ;

/* TRIGGER aft_upd_ventasLineas_logVentasLinea
Este trigger ejecutrara dos sentencias, una para registrar los datos antes de actualizarse y otra para registrarlos ya actualizados
En la tabla logVentasLinea se registrara con un trigger after update:
todos los campos de la tabla ventaslinea (en un registro antes de que se actualicen y en otro consecutivo, ya actualizados)
el usuario
la fecha
la hora
el motivo por el que lo elimina (sera null en este caso)
la accion realizada
*/
DROP TRIGGER IF EXISTS `aft_upd_ventasLineas_logVentasLinea`;

DELIMITER $$ 
$$
CREATE TRIGGER `aft_upd_ventasLineas_logVentasLinea`
AFTER UPDATE ON ventaslinea
FOR EACH ROW
BEGIN
VALUES  (OLD.idVta, 
		 OLD.fecha, 
         OLD.idLinea,
         OLD.cantidad,
         USER(),
         curdate(),
         curtime(),
         NULL,
         "Update");
VALUES  (NEW.idVta, 
		 NEW.fecha, 
         NEW.idLinea,
         NEW.cantidad,
         USER(),
         curdate(),
         curtime(),
         NULL,
         "Update");
END $$
DELIMITER ;

